webpackJsonp([0xa00658439aff],{1618:function(a,e){a.exports={data:{markdownRemark:{html:'<p>뉴스 부서는 내 학생들이 내게 와서 나 자신에 대해 몇 가지 질문을 할 것이라고 쓴다. 시립 고등 교육국의지도이기 때문에 받아 들일 수 없습니다. 그녀는 "복단 단지"가 의미하는 바를 물었다. 나는 그런 시적인 이미지가 없다고 말했다. 나는 복단에 삶의 순환계가있다. 나는 떠날 수 없다. 복단의 어조로, 어쩌면 인생이 있을지도 모른다. 친구와 스포츠의 관계에서, 그것은이 푸른 하늘에 있을지도 모릅니다. 사람들의 삶은 언제나 생계를 유지합니다. 부모를 잃은 후에 갑자기 이런 생계 유지가 중요하다고 느낍니다. 자녀가 없으면 가족의 온기가 없으며 유일한 생계는 삶이 소비되는 곳입니다. 이런 세상에는 많은 사람들이있을 수 있습니다. 이것은 삶의 구조입니다.</p>',id:"/home/swain/workspace/political-life/src/pages/ko/0065.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/ko/0065.md",frontmatter:{title:"4월 2일 토요일"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/ko/0065.md absPath of file >>> MarkdownRemark"}}}});
